import React, { Fragment } from "react";
import { Link } from "react-router-dom";

const Sidebar = () => {
  return (
    <Fragment>
      <li>
        <Link to='/register'>About</Link>
      </li>
      <li>
        <Link to='/login'>Contact</Link>
      </li>
    </Fragment>
  );
};

export default Sidebar;
